import React from 'react';
import logo from './logo.svg';

import '../public/css/fonts.css';
import '../public/css/bootstrap.css';
import '../public/css/font-awesome.min.css';
import '../public/js/plugins/swiper/css/swiper.min.css';
import '../public/js/plugins/nice_select/nice-select.css';
import '../public/js/plugins/player/volume.css';
import '../public/js/plugins/scroll/jquery.mCustomScrollbar.css';
import '../public/';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
